import { useEffect, useState } from "react";
import { Card, Col, Table } from 'react-bootstrap';
import { useDispatch, useSelector } from "react-redux";
import { getHist } from "../../store/actions/allbooks";

function AllAdmissions(){
    const dispatch = useDispatch();
    const { list } = useSelector((state) => state.hist);

    useEffect(() => {
        dispatch(getHist());
    }, [dispatch]);

    return (
        <div>
            <Col md={{ span: 6, offset: 3 }}>
                <Card bg="secondary" text="white" style={{ width: '70%' }}>
                    <Card.Header style={{ backgroundColor: 'gray', color: '#fff', fontSize: '140%' }}>History</Card.Header>
                    <Card.Body>
                        <Table striped bordered hover variant="dark">
                            <thead>
                                <tr>
                                    <th>SI No</th>
                                    <th>ID</th>
                                    <th>Return Date</th>
                                    <th>Issue Date</th>
                                    <th>Fine Amount</th>
                                    {/* Add more table headers as needed */}
                                </tr>
                            </thead>
                            <tbody>
                                {list.map((hist, index) => (
                                    <tr key={index}>
                                        <td>{index + 1}</td>
                                        <td>{hist.id}</td>
                                        <td>{hist.retrundate}</td>
                                        <td>{hist.issuedate}</td>
                                        <td>{hist.amount}</td>
                                        {/* Add more table cells with admission data */}
                                    </tr>
                                ))}
                            </tbody>
                        </Table>
                    </Card.Body>
                </Card>
            </Col>
        </div>
    )
}

export default AllAdmissions;
